    <script src="../js/script.js"></script>
    <script>
        //Happy Cube
        var happyCube = document.getElementById('happy-cube');

        var happyOptions = document.querySelector('.happy-maze-options');

        var happyCubeClick = 0;

        var spinTheHappyCube = () => {
            happyCubeClick++;
            if (happyCubeClick === 1) {
                happyCube.classList.remove('happy-cube-1');
                happyCube.classList.add('happy-cube-2');
                happyOptions.innerHTML = "<p>Friends</p>";
            } else if (happyCubeClick === 2) {
                happyCube.classList.remove('happy-cube-2');
                happyCube.classList.add('happy-cube-3');
                happyOptions.innerHTML = "<p>School</p>";
            } else {
                happyCube.classList.remove('happy-cube-3');
                happyCube.classList.add('happy-cube-1');
                happyOptions.innerHTML = "<p>Family</p>";
                happyCubeClick = 0;
            }
        }

        happyCube.addEventListener('click', spinTheHappyCube);

        // Happy wheel
        var wheel = document.getElementById('spin');

        var wheelquestions = document.getElementById('wheel-questions');

        var wheelclick = -1;

        const happyQuestions = ["What are you grateful for?", "Why does this make you happy?", "What made you smile today?", "What do you want to remember about today?"];

        function wheelanimation() {
            wheelquestions.classList.add('hide');
            wheelquestions.innerText = happyQuestions[wheelclick];
            wheel.classList.add('spin-wheel');
            setTimeout(() => { wheelquestions.classList.remove('hide') }, 3000);
            setTimeout(() => { wheel.classList.remove('spin-wheel') }, 3000);
        }

        var spinTheWheel = () => {
            wheelclick++;
            if (wheelclick < happyQuestions.length) {
                wheelanimation();
            } else {
                wheelclick = -1;
            }
        }

        wheel.addEventListener('click', spinTheWheel);

        //END OF HAPPY ELEMENTS
    </script>
